import './App.css';
import {BrowserRouter  as Router , Switch , Route} from 'react-router-dom'
import Home from './Components/Home';
import About from './Components/About';
import Login from './Components/Login';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/home">
            <Home/>
          </Route>
          <Route path="/about">
            <About/>
          </Route>
          <Route path="/">
            <Login/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
